{"operationName":"otherStacks","variables":{"id":"8villages/8villages","limit":3},"query":"query otherStacks($id: String!, $limit: Int!) {
  stackProfile(identifier: $id) {
    id
    otherStacks(first: $limit) {
      count
      edges {
        node {
          id
          slug
          name
          services {
            id
            name
            slug
            title
            imageUrl
            layer {
              slug
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
